{'description': 'Первая партия билетов в продаже 22 августа в 12:00\n\n***\nPortraits: Marco Carola\n1 декабря | ночной клуб CHI (Парковая дорога 16а)\n\nВ первый день зимы в рамках серии вечеринок “Portraits” выступит “Крестный отец” итальянского техно Marco Carola.\n\nЕсть артисты, привезти которых легко. А есть такие, привезти которых сложно. Но еще есть артисты, организовать выступление которых - практически невозможно. И Марко Карола - среди последних. \n\nОн - один из представителей современной электронной музыки, на которых равняется весь музыкальный мир. Миллионы меломанов и тысячи артистов - как молодых, так уже и состоявшихся - с открытыми ртами ждут, что им представит “кутюрье” в этот раз. Его музыка по молекулам разлетается по всей планете и меняет музыкальный мир.\n\nМузыка ветерана техно Marco Carola всегда остаётся актуальной, благодаря его способности постоянно меняться и следовать свои инстинктам, которые никогда его не подводят. «Когда я пишу или играю, я не думаю о том, куда моя музыка меня приведёт – я просто погружаюсь в свои чувства».', 'end_time': '2018-12-02T06:00:00+0200', 'name': 'Portraits with Marco Carola', 'place': {'name': 'CHI by Decadence House', 'location': {'city': 'Kyiv', 'country': 'Ukraine', 'latitude': 50.45135, 'located_in': '172195389582785', 'longitude': 30.53752, 'street': 'Парковая дорога 16а', 'zip': '01021'}, 'id': '426739177373458'}, 'start_time': '2018-12-01T22:00:00+0200', 'id': '2570448746314123'};


