      'description': 'Щороку ми збираємо волонтерів, щоб сказати їм: «Ваша праця неоціненна!» \n\nНа попередні премії номінували сотні волонтерів з усіх куточків країни, різних сфер діяльності, різного віку та місця проживання. У 2018 відбудеться вже 5 церемонія нагородження. \n\nМи не просто нагороджуємо волонтерів, ми хочемо дати їм можливість розповісти тисячам людей про свій проект, привернути увагу до важливої проблеми та надихнути мільйони Українців займатися волонтерством. Тому перебіг премії кожен рік висвітлюють провідні Українські ЗМІ.\n\nНомінанти премії - волонтери, які не належать до керівних позицій політичних сил та не отримують матеріальне винагородження за свою волонтерську роботу. \n\nНезалежне журі обире лауреатів премії, історії яких вражають та надихають на волонтерську діяльність. За 5 років серед нашого журі були такі визначні особистості як: Соломія Вітвіцька, Сергій Жадан, , Олександра Кольцова, Богдан Гаврилишин, Любомир Гузар, Олександра Матвійчук. \n\n--------------------------------------------\n\nПремію заснувала громадська організація Євромайдан SOS в листопаді 2014 року, коли масштабний волонтерський рух в України став визначальною відповіддю на нові виклики нашого суспільства.\n\nЦеремонія нагородження відбудеться як завжди - 30 листопада 2018 року. За додатковою інформацією звертайтеся на електронну адресу evromaidansos@gmail.com\n\nСлідкуйте за новинами!',
