      'description': 'Подія року у стоматологічному світі України!\nВперше Dr. Otto Zuhr відвідає Україну 29 листопада!\n\n\nDr. Otto Zuhr вивчав стоматологію в Університеті Аахена з 1986 по 1992 рік та є сертифікованим пародонтологом, членом Німецької спілки пародонтологів. Разом із Маркусом Хюрцелером він відкрив приватну практику з пародонтології та зубної імплантології у м. Мюнхен, Німеччина. \nМаючи за плечима понад 25 років клінічного досвіду та викладацької практики, Dr. Otto Zuhr  є визнаним експертом у своїй галузі далеко за межами Європи. З період з 2007 по 2014 рік він був членом ради директорів Німецької спілки пародонтологів, а наразі обіймає посаду ад’юнкт професора Відділу Пародонтології в Університеті Йоганна Вольфганга Гете у м. Франкфурт-на-Майні, Німеччина (директор – професор Пітер Айкхольц).\nDr. Otto Zuhr є автором кількох рецензованих наукових публікацій у галузі пародонтології та зубної імплантології, а у 2012 видавництво Quintessence видало його книгу під назвою «Пластична естетична пародонтальна та імплантаційна хірургія». Наукові інтереси Отто Цура зосереджені на загоєнні ран та реконструкції м’яких тканин ротової порожнини. \n\n\nDr. Otto Zuhr є визнаним у всьому світі спеціалістом із міжнародною репутацією в галузі пародонтології, лікування періімплантиту, а також естетичної корекції ясен. Отто Зур Отто Зур (DR. Otto Zuhr) вивчав стоматологію в Університеті Аахена та у США. Він спеціалізується на пародонтології, з 2007 року він є членом ради директорів Німецької Асоціації Пародонтологів. У 2011 році разом із професором Хюрцелером він видав посібник «Пластична естетична пародонтальна та імплантаційна хірургія», який отримав схвальні відгуки від колег, які зазначили, що це «без сумніву, одна з найважливіших публікацій у галузі стоматологічної хірургії за останні роки, і є обов’язковою для ознайомлення для всіх пародонтологів та імплантологів». \n\n\nЧого очікувати від лекції ?\nВпродовж останніх 50 років зубні імплантати стали простим та ефективним методом заміни пошкоджених або видалених зубів. Проте неперервний розвиток імплантаційної стоматології свідчить про те, що якість та о’бєм періімплантатних м’яких тканин відіграють ключову роль у досягненні найкращих результатів. Це пояснюється кількома причинами. \nПо-перше, результати досліджень свідчать про високу частоту біологічних ускладнень у вигляді запалення слизової оболонки періімплантатних ділянок та періімплантиту. \nІншим ключовим фактором є те, що незважаючи на подібність пародонту природних зубів до періімплантатних тканин, необхідно враховувати різницю між ними у різних аспектах. Окрім того, природний та привабливий вид зубних імплантатів, розташованих у зоні посмішки, вимагає збереження, а іноді й реконструкції м’яких тканин. На цьому дводенному практичному семінарі ми детально розглянемо сучасні клінічні питання, які стосуються обробки та реконструкції м’яких тканин навколо імплантатів. Окрім теоретичних та практичних засад на семінарі будуть розглядатися та обговорюватися сучасні інноваційні стратегії вирішення відповідних завдань, завдяки чому учасники набудуть інформації та знань, необхідних для успішних результатів зубної імплантології, де успіх полягає не лише в біологічному та естетичному аспекті, але й у стабільно передбачуваних результатах у довгостроковій перспективі.\n\nВартість участі: 295 евро при реєстрації до 1 вересня\n                           350 евро при реєстрації  після 1 вересня\n\nРеєстрація онлайн: http://zuhr.biogentech.com.ua/\n\nРеєстрація за телефонами:  +38 097 443-23-71 \n                                                +38 099 443-23-71\n                                                +38 044 337-78-08\n\nМісце проведення:\nFAIRMONT GRAND HOTEL KYIV, вулиця Набережно-Хрещатицька, 1',
